(4, 'Thế giới hoàn mỹ', '<p>PHIM ĐƯỢC CẬP NHẬT 1 TẬP MỖI TRƯA THỨ 6 H&Agrave;NG TUẦN</p>rnrn<p>Main: Hoang Thi&ecirc;n Đế - Thạch Hạo</p>rnrn<p>Vợ: Hỏa Linh Nhi (ch&iacute;nh thất), V&acirc;n Hi (mẹ của Tiểu Thạch Đầu), Thanh Y&nbsp;</p>rnrn<p>Cảnh giới:&nbsp;</p>rnrn<p>Ph&agrave;m Nh&acirc;n:<br />rn1. B&agrave;n Huyết Cảnh<br />rn2. Động Thi&ecirc;n Cảnh: 1 Động Thi&ecirc;n &ndash; 10 Động Thi&ecirc;n (Cực Cảnh)<br />rn3. H&oacute;a Linh Cảnh: Th&acirc;n Thể Th&agrave;nh Linh &ndash; Trọng Tố Ch&acirc;n Ng&atilde; &ndash; Động Thi&ecirc;n Dưỡng Linh<br />rn4. Minh Văn Cảnh (Phong Hầu)<br />rn5. Liệt Trận Cảnh (Vương Giả)<br />rn6. T&ocirc;n Giả Cảnh<br />rnThần Đạo:<br />rn1. Thần Hỏa Cảnh (Ngụy Thần)<br />rn2. Ch&acirc;n Nhất Cảnh (Ch&acirc;n Thần)<br />rn3. Th&aacute;nh Tế Cảnh (Thần Vương)<br />rn4. Thi&ecirc;n Thần Cảnh<br />rn5. Hư Đạo Cảnh<br />rn6. Trảm Ng&atilde; Cảnh<br />rn7. Độn Nhất Cảnh (Ch&iacute; T&ocirc;n)<br />rn8. Ch&iacute; T&ocirc;n Cảnh<br />rn9. Ch&iacute; T&ocirc;n Cực Đạo (Nh&acirc;n Đạo Đỉnh Phong)<br />rnTi&ecirc;n Đạo (Trường Sinh Lĩnh Vực): Ch&acirc;n Ti&ecirc;n &rarr; Ti&ecirc;n Vương &rarr; Chuẩn Ti&ecirc;n Đế &rarr; Ti&ecirc;n Đế<br />rnHệ Thống Tu Luyện do main tự s&aacute;ng tạo: Lu&acirc;n Hải B&iacute; Cảnh &rarr; Đạo Cung B&iacute; Cảnh &rarr; Tứ Cực B&iacute; Cảnh &rarr; H&oacute;a Long B&iacute; Cảnh &rarr; Ti&ecirc;n Đ&agrave;i B&iacute; Cảnh (thế thứ 10 Độ Kiếp Th&agrave;nh Ch&acirc;n Ti&ecirc;n) &rarr; Ti&ecirc;n Vương &rarr; Chuẩn Ti&ecirc;n Đế &rarr; Ti&ecirc;n Đế</p>', 'thegioihoanmy.jpg', 130, '2022-12-05 00:00:00', '2022-12-17 22:26:57', '2022-12-18 01:42:10'),
(5, 'Đấu la đại lục', '<p><strong>PHIM ĐƯỢC CẬP NHẬT 1 TẬP MỖI TRƯA THỨ 7 H&Agrave;NG TUẦN</strong></p>rnrn<p>&nbsp; &nbsp; &nbsp; &nbsp;Mở đầu c&acirc;u chuyện xuất hiện một nam nh&acirc;n t&ecirc;n Đường Tam bị Đường M&ocirc;n truy s&aacute;t, l&agrave; t&ocirc;ng m&ocirc;n nổi tiếng với c&aacute;c loại cơ quan &aacute;m kh&iacute; nhất l&agrave; &quot;Phật nộ đường li&ecirc;n&quot;. Th&acirc;n l&agrave; thi&ecirc;n t&agrave;i ng&agrave;n năm c&oacute; một nhưng v&igrave; chỉ c&oacute; th&acirc;n phận ngoại m&ocirc;n đồ.</p>rnrn<p>&nbsp; &nbsp; &nbsp; &nbsp;V&igrave; chứng minh hắn chưa bao giờ qu&ecirc;n cội nguồn n&ecirc;n Đường Tam đ&atilde; tự s&aacute;t, kh&ocirc;ng ngờ hắn lại xuy&ecirc;n kh&ocirc;ng trọng sinh v&agrave;o một đứa trẻ c&ugrave;ng t&ecirc;n tr&ecirc;n một nơi kỳ lạ gọi l&agrave; Đấu La đại lục. Người tr&ecirc;n Đấu La đại lục, vũ hồn sẽ Gi&aacute;c Tỉnh l&uacute;c s&aacute;u tuổi, Vũ hồn chia l&agrave;m hai loại lớn, một loại l&agrave; kh&iacute; vũ hồn, một loại l&agrave; th&uacute; vũ hồn.</p>rnrn<p>&nbsp; &nbsp; &nbsp; &nbsp;Đấu La Đại Lục l&agrave; c&acirc;u chuyện về qu&aacute; tr&igrave;nh trưởng th&agrave;nh của Đường Tam tại Đại Lục Đấu La, c&ugrave;ng t&igrave;nh cảm từ thuở thanh mai tr&uacute;c m&atilde; với &quot;đại tỷ&quot; Tiểu Vũ đầy b&iacute; ẩn, giữa t&igrave;nh th&acirc;n gia đ&igrave;nh, t&igrave;nh thầy tr&ograve; với Đại sư, giữa c&aacute;c đồng đội trong đội ngũ Sử Lai Khắc, c&ugrave;ng học hỏi lẫn nhau c&ugrave;ng s&aacute;t c&aacute;ch chiến đấu trong những trận chiến sinh tử cận kề.</p>rnrn<p>Đẳng cấp hồn sư: Hồn Sĩ (Cấp 1 - Cấp 10) - Hồn Sư (Cấp 11 - Cấp 20) - Đại Hồn Sư (Cấp 21 - Cấp 30) - Hồn T&ocirc;n (Cấp 31 - Cấp 40) - Hồn T&ocirc;ng (Cấp 41 - Cấp 50) - Hồn Vương (Cấp 51 - Cấp 60) - Hồn Đế (Cấp 61 - Cấp 70) - Hồn Th&aacute;nh (Cấp 71 - Cấp 80) - Hồn Đấu La (Cấp 81 - Cấp 90) - Phong H&agrave;o Đấu La (Cấp 91 - Cấp 100) - Thần (Tr&ecirc;n Cấp 100).</p>rnrn<p>&nbsp; &nbsp; &nbsp; &nbsp;Trong Phong H&agrave;o Đấu La chia l&agrave;m 4 đẳng cấp: Phổ Th&ocirc;ng Phong H&agrave;o Đấu La (Cấp 91 - Cấp 94) - Đỉnh Phong Đấu La (Cấp 95 - Cấp 98) - {Tuyệt Thế Đấu La - B&aacute;n Thần} (Cấp 99 - Cấp 100).</p>rnrn<p>&nbsp; &nbsp; &nbsp; &nbsp;Phẩm chất Hồn Ho&agrave;n: [ Mười năm ]&nbsp;- [ Trăm năm ]&nbsp;- [ Ngh&igrave;n năm ]&nbsp;- [ Vạn năm ]&nbsp;- [ Mười vạn năm ]&nbsp;- [ Trăm vạn năm ] - Thần cấp (T&ugrave;y v&agrave;o thần vị thần cấp m&agrave; m&agrave;u sắc Hồn Ho&agrave;n kh&aacute;c nhau).</p>', 'dauladailuc.jpg', 250, '2022-11-27 00:00:00', '2022-12-16 01:46:26', '2022-12-16 01:46:26'),
(6, 'Nhất niệm vĩnh hằng', '<p><strong>PHIM ĐƯỢC CẬP NHẬT 1 TẬP MỖI TRƯA THỨ 4 H&Agrave;NG TUẦN</strong></p>rnrn<p>&nbsp;</p>rnrn<p>&nbsp;</p>rnrn<p>&nbsp;</p>rnrn<p><strong>Phần 2: Truyền Thừa bắt đầu từ tập 53</strong></p>rnrn<p>Main: Bạch Tiểu Thuần</p>rnrn<p>Vợ:&nbsp;Tống Qu&acirc;n Uyển, Chu Tử Mạch, Hầu Tiểu Muội, C&ocirc;ng T&ocirc;n Uyển Nhi, Đỗ Lăng Phi</p>rnrn<p>Cảnh giới:</p>rnrn<ul>rn	<li>Ngưng Kh&iacute; Cảnh: Từ tầng 1 đến Tầng 10</li>rn	<li>Tr&uacute;c Cơ Cảnh: Sơ Kỳ &ndash; Trung Kỳ &ndash; Hậu kỳ &ndash; Đại Vi&ecirc;n M&atilde;n</li>rn	<li>Kim Đan Cảnh: Sơ Kỳ &ndash; Trung Kỳ &ndash; Hậu kỳ &ndash; Đại Vi&ecirc;n M&atilde;n</li>rn	<li>Nguy&ecirc;n Anh Cảnh: Sơ Kỳ &ndash; Trung Kỳ &ndash; Hậu kỳ &ndash; Đại Vi&ecirc;n M&atilde;n &ndash; Nửa Bước Thi&ecirc;n Nh&acirc;n</li>rn	<li>Thi&ecirc;n Nh&acirc;n Cảnh: Sơ Kỳ &ndash; Trung Kỳ &ndash; Hậu kỳ &ndash; Đại Vi&ecirc;n M&atilde;n &ndash; Thi&ecirc;n T&ugrave;y Nh&acirc;n Nguyện &ndash; Thế Giới Chi Y&nbsp;</li>rn	<li>B&aacute;n Thần Cảnh: Sơ Kỳ &ndash; Trung Kỳ &ndash; Hậu kỳ &ndash; Đại Vi&ecirc;n M&atilde;n (Đỉnh Phong). Tiến tới Chuẩn Đại Thừa (Chuẩn Thi&ecirc;n T&ocirc;n)</li>rn	<li>Đại Thừa Cảnh (Thi&ecirc;n T&ocirc;n): Sơ Kỳ &ndash; Trung Kỳ &ndash; Hậu Kỳ &ndash; Đại Vi&ecirc;n M&atilde;n. Tiến tới Nửa Bước Th&aacute;i Cổ (Chuẩn Th&aacute;i Cổ)</li>rn	<li>Th&aacute;i Cổ Cảnh (Ho&agrave;ng Giả): Sơ Kỳ &ndash; Trung Kỳ &ndash; Hậu Kỳ &ndash; Đại Vi&ecirc;n M&atilde;n. Tiến tới Nửa Bước Ch&uacute;a Tể (Chuẩn Ch&uacute;a Tể)</li>rn	<li>Tổ Cảnh: Tu Vi Th&aacute;i Cổ v&agrave; Nhục Th&acirc;n Th&aacute;i Cổ</li>rn	<li>Ch&uacute;a Tể Cảnh</li>rn	<li>Vĩnh Hằng Cảnh</li>rn</ul>', 'nhatniemvinhhang.jpg', 90, '2022-12-13 00:00:00', '2022-12-16 01:47:42', '2022-12-16 01:47:42'),
(7, 'Thôn phệ tinh không', '<p><strong>PHIM ĐƯỢC CẬP NHẬT 1 TẬP MỖI THỨ 4 H&Agrave;NG TUẦN</strong></p>rnrn<p><em>Phần 2 bắt đầu từ tập 27</em></p>rnrn<p>Main: La Phong&nbsp;</p>rnrn<p>Vợ: Từ H&acirc;n</p>rnrn<p>C&aacute;c cấp độ:</p>rnrn<p>&nbsp;- Trường ph&aacute;i: Vũ giả &ndash; Tinh Thần Niệm Sư (Bậc Thầy Tinh Thần) Khống Vật &ndash; Tinh Thần Niệm Sư (Bậc Thầy Tinh Thần) Huyễn thuật &ndash; Tề Dược Sư&hellip;</p>rnrn<p>&nbsp;- Tr&igrave;nh độ địa cầu: Chiến sĩ - Chiến tướng - Chiến thần ( Trực thuộc cấp Học đồ )</p>rnrn<p>&nbsp;- Tr&igrave;nh độ to&agrave;n vũ trụ:&nbsp;</p>rnrn<p>Học đồ - H&agrave;nh tinh - Hằng tinh - Vũ trụ - Vực chủ - Giới chủ - Bất hủ - Bất hủ qu&acirc;n chủ - Bất hủ phong Hầu - Bất hủ phong Vương - Vũ trụ t&ocirc;n giả - Vũ trụ b&aacute; chủ (Vũ trụ t&ocirc;n giả v&ocirc; địch) - Vũ trụ chi chủ (lực chiến 1-6) - Vũ trụ tối cường giả = Ch&acirc;n thần (lực chiến &gt; 6) - Hư kh&ocirc;ng ch&acirc;n thần (lực chiến &gt; 10) - Vĩnh hằng ch&acirc;n thần - Hỗn Độn ch&uacute;a tể - Thần vương - Hỗn nguy&ecirc;n - L&atilde;nh ch&uacute;a.</p>rnrn<p><em>Giới thiệu nội dung:</em></p>rnrn<p>Một ng&agrave;y nọ, thế giới xuất hiện loại virus RR kh&ocirc;ng r&otilde; lai lịch, cuốn thế giới v&agrave;o thảm hoạ. Động vật bị truyền nhiễm đột biến th&agrave;nh qu&aacute;i th&uacute; đ&aacute;ng sợ, x&acirc;m lược với số lượng lớn. Trong l&uacute;c lo&agrave;i người đối mặt với diệt vong, họ đ&atilde; x&acirc;y l&ecirc;n bức tường bao v&acirc;y, th&agrave;nh lập căn cứ l&agrave;m ph&aacute;o đ&agrave;i cuối c&ugrave;ng bảo vệ con người.&nbsp;</p>rnrn<p>Trong thời gian n&agrave;y, con người nếm trải đủ mọi kh&oacute; khăn, được gọi l&agrave; &ldquo;thời kỳ Đại Niết B&agrave;n&rdquo;. Trong&nbsp;m&ocirc;i trường sinh tồn cực đoan, bản năng của con người cũng dần ph&aacute;t triển, ngọn gi&oacute; thượng v&otilde; phất l&ecirc;n, tố chất cơ thể con người vượt trội hơn trước. M&agrave; trong những người xuất sắc, được gọi l&agrave; &ldquo;chiến binh&rdquo;. La Phong năm 18 tuổi cũng ước mơ trở th&agrave;nh một trong số họ. Cậu l&uacute;c n&agrave;y sắp phải thi đại học, đang đối diện với sự lựa chọn giữa ng&atilde; tư đời người. Nhưng lại bị qu&aacute;i th&uacute; tấn c&ocirc;ng ảnh hưởng quỹ đạo cuộc đời của cậu hết lần n&agrave;y đến lần kh&aacute;c.&nbsp;</p>rnrn<p>Dưới uy hiếp của qu&aacute;i th&uacute;, cư d&acirc;n trong th&agrave;nh phố đối diện với nguy hiểm, qu&acirc;n sự lại b&oacute; tay. Duy chỉ c&oacute; chiến binh x&ocirc;ng pha, bảo vệ an to&agrave;n cho căn cứ. La Phong được những chiến binh truyền cảm hứng, &acirc;m thầm hạ quyết t&acirc;m trở th&agrave;nh chiến binh bảo vệ người m&igrave;nh y&ecirc;u thương. Đ&acirc;y ch&iacute;nh l&agrave; khởi đầu của mọi thứ, khởi điểm của&nbsp; con đường chiến binh La Phong, cũng v&eacute;n bức m&agrave;n cuộc đời truyền k&igrave; của cậu. La Phong lập ch&iacute; trở th&agrave;nh chiến binh. Con đường ph&iacute;a kh&ocirc;ng dễ d&agrave;ng, đầu ti&ecirc;n cậu phải đối diện với m&ocirc;i trường ngoại bộ, v&ocirc; h&igrave;nh chung c&agrave;ng th&ecirc;m ảnh hưởng tới cậu. Gia đ&igrave;nh La Phong c&oacute; điều kiện kh&ocirc;ng tốt, cuộc sống t&uacute;ng thiếu, bố mẹ kh&ocirc;ng thể gi&uacute;p đỡ cậu được nhiều, cậu đ&agrave;nh dựa v&agrave;o nỗ lực của bản th&acirc;n.&nbsp;</p>rnrn<p>Cuối c&ugrave;ng, dưới sự khổ luyện, La Phong kh&ocirc;ng ngừng khai quật ra tiềm năng của m&igrave;nh, nhận được sự n&acirc;ng cấp năng lực với sự c&ocirc;ng nhận gi&aacute; trị bản th&acirc;n. Kh&ocirc;ng những vậy, La Phong c&ograve;n g&aacute;nh v&aacute;c g&aacute;nh nặng nu&ocirc;i dưỡng&nbsp; gia đ&igrave;nh, cũng v&igrave; bảo vệ tổ quốc lo&agrave;i người, v&igrave; cuộc sống sinh tồn v&agrave; ph&aacute;t triển tốt hơn của con người. C&ugrave;ng với những chiến binh ch&iacute;nh nghĩa kh&aacute;c, li&ecirc;n minh đối ph&oacute; qu&aacute;i th&uacute; hung &aacute;c. Dưới t&igrave;nh cảnh tận thế, La Phong c&ugrave;ng với những chiến binh kh&aacute;c liệu c&oacute; thể đẩy l&ugrave;i qu&aacute;i th&uacute;, th&agrave;nh c&ocirc;ng bảo vệ thế giới lo&agrave;i người?</p>', 'thonphetinhkhong.jpg', 120, '2023-01-01 00:00:00', '2022-12-16 01:48:49', '2022-12-16 01:48:49'),
(8, 'Thần ấn vương tọa', '<p><strong>PHIM ĐƯỢC CẬP NHẬT 1 TẬP MỖI TRƯA THỨ 5 H&Agrave;NG TUẦN</strong></p>rnrn<p>Main: Long Hạo Thần</p>rnrn<p>Người chơi hệ chung t&igrave;nh 1 vợ: Th&aacute;nh nữ Lu&acirc;n Hồi - Thải Nhi&nbsp;</p>rnrn<p>C&aacute;c cấp kỵ sĩ:</p>rnrn<ul>rn	<li>Người hầu Kỵ Sĩ (Kỵ Sĩ T&ugrave;y T&ugrave;ng): 10 &ndash; 100 điểm linh lực.</li>rn	<li>Kỵ Sĩ Chuẩn: 101 &ndash; 200 điểm linh lực.</li>rn	<li>Kỵ sĩ: 201 &ndash; 500 điểm linh lực.</li>rn	<li>Đại Kỵ sĩ: 501 &ndash; 2000 điểm linh lực.</li>rn	<li>Kỵ Sĩ Đại Địa: 2001 &ndash; 4000 điểm linh lực.</li>rn	<li>Kỵ Sĩ Huy Diệu: 4001 &ndash; 10000 điểm linh lực.</li>rn	<li>Kỵ Sĩ Th&aacute;nh Điện &nbsp;: 10001 &ndash; 30 ng&agrave;n điểm linh lực</li>rn	<li>Th&aacute;nh Kỵ Sĩ :30001 &ndash; 100 ng&agrave;n điểm linh lực.</li>rn	<li>Kỵ Sĩ Thần Th&aacute;nh: 100 ng&agrave;n điểm linh lực trở l&ecirc;n.</li>rn</ul>', 'thananvuongtoa.jpg', 53, '2022-12-12 00:00:00', '2022-12-16 01:50:02', '2022-12-16 01:50:02'),
(9, 'Vũ động càn khôn', '<p><em><strong>Phần 3 bắt đầu từ tập 25</strong></em></p>rnrn<p>Main: V&otilde; Tổ -&nbsp;L&acirc;m Động</p>rnrn<p>Vợ: Lăng Thanh Tr&uacute;c, Ứng Hoan Hoan</p>rnrn<p>Cấp độ tu vi:</p>rnrn<ul>rn	<li>Thối thể: &nbsp;Thối Thể ch&iacute;nh l&agrave; t&ocirc;i luyện cơ thể, l&agrave;m cho th&acirc;n thể m&igrave;nh dần dần mạnh l&ecirc;n, từ trong ra ngo&agrave;i. Khi g&acirc;n, cốt, tủy trong cơ thể được mạnh l&ecirc;n đến một mức nhất định, cũng l&agrave; l&uacute;c ph&aacute;t sinh ra một tia nguy&ecirc;n lực, m&agrave; khi xuất hiện nguy&ecirc;n lực tức l&agrave; đ&atilde; ch&iacute;nh thức trở th&agrave;nh một người tu luyện.</li>rn	<li>Địa Nguy&ecirc;n cảnh &ndash; Thi&ecirc;n Nguy&ecirc;n cảnh &ndash; Nguy&ecirc;n Đan cảnh (c&oacute; tiểu vi&ecirc;n m&atilde;n v&agrave; đại vi&ecirc;n m&atilde;n)</li>rn	<li>Tạo ho&aacute; tam cảnh: Tạo H&igrave;nh cảnh -Tạo Kh&iacute; cảnh &ndash; Tạo Ho&aacute; cảnh.</li>rn	<li>Niết b&agrave;n cảnh: nhất kiếp đến cửu kiếp.</li>rn	<li>Sinh tử cảnh: Sinh huyền cảnh &ndash; Tử huyền cảnh.</li>rn	<li>Lu&acirc;n hồi cảnh: Chuyển lu&acirc;n cảnh &ndash; lu&acirc;n hồi cảnh (nhất kiếp đến tam kiếp lu&acirc;n hồi).</li>rn	<li>Tổ cảnh.</li>rn</ul>', 'vudongcankhon.jpg', 300, '2022-12-13 00:00:00', '2022-12-16 01:51:21', '2022-12-16 01:51:21'),
(10, 'Vô thượng thần đế', '<h2>Nội dung</h2>rnrn<p>&nbsp;</p>rnrn<p><strong>PHIM ĐƯỢC CẬP NHẬT MỖI THỨ 2 V&Agrave; THỨ 6 H&Agrave;NG TUẦN</strong></p>rnrn<p>Main: Ti&ecirc;n Vương Mục V&acirc;n&nbsp;</p>rnrn<p>9 vợ: Mạnh Tử Mặc, Tần Mộng Dao, Diệp Tuyết Kỳ, Ti&ecirc;u Do&atilde;n Nhi, Vương T&acirc;m Nh&atilde;, Cửu Nhi, Diệu Ti&ecirc;n Ngữ, Minh Nguyệt T&acirc;m, B&iacute;ch Thanh Ngọc&nbsp;</p>rnrn<p>Cảnh giới: Nhục Th&acirc;n-Linh Khiếu-Th&ocirc;ng Thần-Niết B&agrave;n-Tam Chuyển Chi cảnh-Vũ Ti&ecirc;n cảnh - Sinh Tử cảnh<br />rnTi&ecirc;n giới : Nh&acirc;n Ti&ecirc;n - Địa Ti&ecirc;n - Thi&ecirc;n Ti&ecirc;n - Huyền Ti&ecirc;n - Ch&acirc;n Ti&ecirc;n - Kim Ti&ecirc;n - Đại La Kim Ti&ecirc;n - Ti&ecirc;n Vương - Ti&ecirc;n Đế<br />rnThần giới: Hư Thần - Ch&acirc;n Thần - Địa Thần - Thi&ecirc;n Thần - Thần Qu&acirc;n - Thần Vương - Thần Ho&agrave;ng - Thần Chủ - Tổ Thần - Hư Th&aacute;nh - B&aacute;n Th&aacute;nh - H&oacute;a Th&aacute;nh.<br />rnThương Lan giới: Th&aacute;nh vị : Th&aacute;nh Nh&acirc;n- Đại Th&aacute;nh-Cổ Th&aacute;nh - Th&aacute;nh Vương - Th&aacute;nh Ho&agrave;ng - Th&aacute;nh Đế - Thi&ecirc;n Th&aacute;nh Đế - Cổ Th&aacute;nh Đế<br />rnQu&acirc;n vị : Nh&acirc;n Qu&acirc;n - Địa Qu&acirc;n - Thi&ecirc;n Qu&acirc;n - Qu&acirc;n Vương - Th&aacute;nh Qu&acirc;n - Đế Qu&acirc;n.<br />rnT&ocirc;n vị : Ch&iacute; T&ocirc;n - Địa T&ocirc;n - Thi&ecirc;n T&ocirc;n - Thần T&ocirc;n.<br />rnGiới vị : Giới Vương - Giới Ho&agrave;ng - Giới Th&aacute;nh - Giới T&ocirc;n - Giới Thần - Giới Chủ.<br />rnCh&uacute;a Tể - Nửa bước H&oacute;a Đế - Chuẩn Đế - xưng h&agrave;o thần (xưng h&agrave;o đế) - Thần Đế đại đạo ( Đạo Trụ - Đạo Đ&agrave;i - Đạo Hải ) - V&ocirc; Ph&aacute;p - V&ocirc; Thi&ecirc;n - Thần Đế</p>', 'vothuongthande.jpg', 231, '2023-01-07 00:00:00', '2022-12-16 01:52:29', '2022-12-16 01:52:29'),
(11, 'Tru tiên', '<p><strong>PHIM ĐƯỢC CẬP NHẬT 1 TẬP MỖI TRƯA THỨ 3 H&Agrave;NG TUẦN</strong></p>rnrn<p>Main: Trương Tiểu Ph&agrave;m</p>rnrn<p>Harem: Lục Tuyết Kỳ (th&agrave;nh th&acirc;n), B&iacute;ch Dao</p>rnrn<p>Chỉ trong một đ&ecirc;m, Trương Tiểu Ph&agrave;m trở th&agrave;nh c&ocirc; nhi v&agrave; được Thanh V&acirc;n M&ocirc;n nhận l&agrave;m đệ tử. Trải qua 5 năm tu luyện khắc khổ. Ch&agrave;ng đ&atilde; c&oacute; thể hiện xuất sắc trong đại v&otilde; hội Sư M&ocirc;n Thất Mạch. Sau n&agrave;y được ph&aacute;i đến n&uacute;i Kh&ocirc;ng Tang đ&aacute;nh l&ugrave;i ma gi&aacute;o. Trong cuộc h&agrave;nh tr&igrave;nh n&agrave;y, ch&agrave;ng c&ugrave;ng sư tỷ Lục Tuyết Kỳ gặp nhiều nguy nan, v&agrave; giải cứu được nữ tử ma gi&aacute;o B&iacute;ch Dao. Đồng thời, nguy hiểm mới cũng đang đợi ch&agrave;ng ở ph&iacute;a trước.</p>', 'trutien.jpg', 98, '2022-12-20 00:00:00', '2022-12-16 01:53:17', '2022-12-16 01:53:17'),
(12, 'Spy x Family', '<p>Nội dung<br />rnĐặc vụ &quot;Twilight&quot; của Westalis được cử tr&agrave; trộn v&agrave;o nước địch để th&aacute;m s&aacute;t kẻ th&ugrave; đang c&oacute; &acirc;m mưu ph&aacute; hoại nền h&ograve;a b&igrave;nh đ&ocirc;ng t&acirc;y. V&igrave; t&iacute;nh chất của nhiệm vụ, bậc thầy cải trang Twilight bắt buộc phải lập gia đ&igrave;nh v&agrave; c&oacute; con th&igrave; mới c&oacute; thể tiếp cận được mục ti&ecirc;u. Với một kẻ chưa từng c&oacute; người th&acirc;n v&agrave; lu&ocirc;n l&agrave;m việc một m&igrave;nh, Twilight sớm t&igrave;m thấy m&igrave;nh mắc kẹt trong chuyện gia đ&igrave;nh dở kh&oacute;c dở cười.</p>', '3489-1663949277.jpg', 25, '2022-12-23 00:00:00', '2022-12-16 02:46:05', '2022-12-16 02:46:05'),
(13, 'Chainsaw Man', '<p>Nội dung<br />rnCậu thiếu ni&ecirc;n Denji sống một cuộc sống ngh&egrave;o khổ v&agrave; phải l&agrave;m việc vất vả để trả nợ. Cậu vừa sống vừa l&agrave;m Thợ Săn Quỷ c&ugrave;ng với Pochita &ndash; lo&agrave;i quỷ Chainsaw, nhưng rồi một ng&agrave;y cậu trở th&agrave;nh mục ti&ecirc;u của một con quỷ t&agrave;n bạo&hellip;</p>', '3628.jpg', 12, '2022-12-08 00:00:00', '2022-12-16 02:55:44', '2022-12-16 02:55:44'),
(14, 'Bách Luyện Thành Thần', '<p>&nbsp;</p>rnrn<p>PHIM ĐƯỢC CẬP NHẬT V&Agrave;O MỖI THỨ 6 H&Agrave;NG TUẦN</p>rnrn<p>Main: La Chinh (t&ecirc;n giả: La Thi&ecirc;n Chinh)&nbsp;</p>rnrn<p>Chủng tộc: hệ Đ&iacute;ch tộc L&ecirc;&nbsp;</p>rnrn<p>Cảnh giới: &nbsp; *(tham khảo th&ecirc;m tại https://by.com.vn/VJH9C)</p>rnrn<p>Th&acirc;n Thể Cảnh<br />rnTi&ecirc;n Thi&ecirc;n B&iacute; Cảnh&nbsp;<br />rnChiếu Thần Cảnh<br />rnThần Đan Cảnh<br />rnHư Kiếp Cảnh<br />rnSinh Tử Cảnh<br />rnH&oacute;a Thần Tam Biến:<br />rnGiới Chủ Cảnh<br />rnCh&acirc;n Thần Cảnh: Phổ Th&ocirc;ng --- Phong Th&aacute;nh ( Th&aacute;nh Nh&acirc;n ) &lt; &Aacute; Th&aacute;nh --- Ch&acirc;n Th&aacute;nh --- Đại Th&aacute;nh ( Th&aacute;nh Ho&agrave;ng )&nbsp;<br />rnBỉ Ngạn Cảnh: Phổ Th&ocirc;ng --- Hỗn Độn Cổ Thần ( Ch&acirc;n L&yacute; Chi Tử ) --- Chung Y&ecirc;n Chi Chủ --- Chung Cực Chi Thần --- S&aacute;ng Thế Khởi Nguy&ecirc;n Thần<br />rn&nbsp;</p>rnrn<p>Harem: Ninh Vũ Điệp (kết h&ocirc;n chương 936), Kh&ecirc; Ấu Cầm (kết h&ocirc;n chương 1719), Hu&acirc;n, T&ocirc; Linh Vận, H&agrave;m Lưu T&ocirc;, Mục Ngưng, Lăng Sương, Phượng Ca (Phần cuối kết h&ocirc;n với những c&ocirc; g&aacute;i c&ograve;n lại)&nbsp;</p>rnrn<p>Gia đ&igrave;nh: La Ti&ecirc;u (bố), L&ecirc; Lạc Thủy (mẹ), La Y&ecirc;n (em g&aacute;i)&nbsp;</p>rnrn<p>Con c&aacute;i: La Niệm (con trai với Ninh Vũ Điệp), La V&acirc;n H&acirc;n (con g&aacute;i với Kh&ecirc; Ấu Cầm)&nbsp;</p>rnrn<p>Bằng hữu: Hoa Thi&ecirc;n Mệnh, B&aacute;ch L&yacute; Hồng Phong, B&ugrave;i Thi&ecirc;n Diệu, Lại Hoa Thi&ecirc;n, T&ocirc; Khoan, Mạc Nhất Kiếm, Sầu Tuẫn&nbsp;</p>rnrn<p>Sư phụ: Cố Bắc (Thần phương Bắc, vị thần hiền từ nhất trong c&aacute;c thần vực)&nbsp;</p>rnrn<p>&nbsp;</p>rnrn<p>Gia tộc suy t&agrave;n, người th&acirc;n gặp nạn, La Chinh l&ecirc;n voi xuống ch&oacute;, trở th&agrave;nh một t&ecirc;n n&ocirc; lệ thấp h&egrave;n. Khi c&aacute;c gia tộc tranh đấu kh&ocirc;ng ngừng, sức mạnh thần b&iacute; bao tr&ugrave;m thế giới. La Chinh kh&ocirc;ng cam chịu số phận, đ&atilde; t&igrave;nh cờ c&oacute; được c&ocirc;ng ph&aacute;p thần b&iacute;, tự luyện m&igrave;nh th&agrave;nh binh kh&iacute;, mở m&agrave;n cho cuộc tranh đấu cam go.</p>', '1.jpg', 53, '2022-11-27 00:00:00', '2022-12-16 02:58:55', '2022-12-16 02:58:55'),
(15, 'Urusei Yatsura (2022)', '<p>Nội dung<br />rnBộ phim h&agrave;i l&atilde;ng mạn về cậu học sinh cấp ba Ataru Moroboshi gặp n&agrave;ng c&ocirc;ng ch&uacute;a của bộ tộc Quỷ l&agrave; Lum Invader. C&acirc;u chuyện bắt đầu khi h&agrave;nh tinh Quỷ y&ecirc;u cầu con người c&ugrave;ng tham gia v&agrave;o một cuộc thi đuổi bắt, v&agrave; tất nhi&ecirc;n nam ch&iacute;nh của ch&uacute;ng ta ch&iacute;nh l&agrave; người được chọn tham gia cuộc thi n&agrave;y. Luật thi đấu rất đơn giản, Ataru c&oacute; 10 ng&agrave;y để chạm được v&agrave;o sừng của Lum, nếu thất bại, Tr&aacute;i Đất sẽ bị Quỷ x&acirc;m chiếm!</p>', '2.jpg', 23, '2022-01-10 00:00:00', '2022-12-16 03:02:52', '2022-12-16 03:02:52'),
(16, 'Tinh Nguyên Chi Chủ', '<p>Thiếu ni&ecirc;n v&ocirc; dụng T&ocirc; Cửu bị thần thạch Tinh Nguy&ecirc;n tr&ecirc;n trời rơi xuống đập tr&uacute;ng, từ một học sinh b&igrave;nh thường kh&ocirc;ng c&oacute; bất cứ tu luyện n&agrave;o, lại trở th&agrave;nh Chủ Tinh Nguy&ecirc;n t&acirc;n nhiệm. Hai si&ecirc;u đại mỹ nữ của Vạn Giới l&agrave; U Diệc H&agrave;n v&agrave; Thẩm Mộng Tuyết cũng v&igrave; t&igrave;m kiếm Tinh Nguy&ecirc;n m&agrave; tới. Hai người mượn danh nghĩa trốn tr&aacute;nh kẻ th&ugrave; m&agrave; &eacute;p buộc ở nhờ, đồng thời v&igrave; thu h&uacute;t T&ocirc; Cửu gia nhập t&ocirc;ng m&ocirc;n m&igrave;nh m&agrave; tạm thời đạt th&agrave;nh giao k&egrave;o, c&ugrave;ng dạy dỗ T&ocirc; Cửu tu luyện. Ai ngờ, tu vi của T&ocirc; Cửu sở hữu Tinh Nguy&ecirc;n tiến bộ nhanh ch&oacute;ng, vượt xa tưởng tượng của hai c&ocirc; g&aacute;i.</p>', '3.jpg', 42, '2022-12-14 00:00:00', '2022-12-16 07:11:36', '2022-12-16 07:11:36'),
(17, 'Naruto Next Generations', '<p>Naruto l&agrave; một ch&agrave;ng trai trẻ đầy nhiệt huyết cũng như rất nghịch ngợm. Sau tất cả th&igrave; cậu cũng đ&atilde; đạt được ước mơ của m&igrave;nh trở th&agrave;nh một Hokage vĩ đại nhất. Nhưng c&acirc;u chuyện n&agrave;y kh&ocirc;ng phải về Naruto, m&agrave; l&agrave; c&acirc;u chuyện về con trai của Naruto.... Ch&iacute;nh l&agrave; Boruto, thế hệ Ninja tiếp theo.</p>', '4.jpg', 279, '2022-12-29 00:00:00', '2022-12-16 07:16:50', '2022-12-16 07:16:50');

